import React from 'react'
import { Route, Routes } from "react-router-dom";
import Questions from '../Questions/Questions';
import Cuidador from "../Cuidador/Cuidador";

function Main() {
  return (
    <main className='main'>
        <Routes>
         <Route exact path="/pacientes" element={<Questions />} />
         <Route exact path="/cuidador" element={<Cuidador />} />
        </Routes>
    </main>
  )
}

export default Main
